import React, { Component } from "react";
import Course from "./Course";
import { Typography } from "@material-ui/core";

export class CourseList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: true,
      titles: [],
      pictures: [],
    };
  }

  componentDidMount() {
    fetch(
      "https://api.nytimes.com/svc/search/v2/articlesearch.json?q=election&api-key=YW7v4jYO5anNGpDXSmDXZhswezl4w6yZ"
    )
      .then((res) => res.json())
      .then((data) => {
        console.log(data.response);
        let title = data.response.docs.map((article) => {
          return (
            <Typography variant={"body1"}>{article.headline.main}</Typography>
          );
        });
        let url = data.response.docs.map((article) => {
          return article.multimedia.url;
        });
        this.setState({ titles: title });
        this.setState({ pictures: url });
        console.log(this.state.pictures);
      });
  }

  render() {
    return (
      <div>
        {this.state.isLoaded} ? <div>loading...</div> :{" "}
        <Course title={this.state.titles[0]} />
      </div>
    );
  }
}

export default CourseList;
